    var guclu_yanlarin515 = "Using Your Strength in Life "
    var guclu_yanlarin516 = "Your focus on doing the right thing is helpful in many areas of life. As a leader, you inspire people to make fair and good choices. In a team, being yourself helps others trust you and work better together. This makes the team stronger and more successful. "
    var guclu_yanlarin517 = "Your strength of staying true to your values is a big gift in work. It helps you lead with honesty and guide others. By using this strength, you can help your company make good choices and reach success.  "
    var guclu_yanlarin518 = "The Strength of Interaction (6-59)  "
    var guclu_yanlarin519 = "Building Meaningful Connections "
